    false,nt"url": null,nt"notes": "Galapagos Coral Stable Oxygen Calibration
    Data. Sites: Bartolome Island: 0 deg, 17 min S, 90 deg 33 min W. Champion Island:
    1 deg, 15 min S, 90 deg, 05 min W. Urvina Bay (Isabela Island): 0 deg, 23 min S,
    91 deg, 14 min W. Water depth: Bartolome - 3m; Champion - 10m; Urvina- 3m. Species:
    Bartolome - bart1, bart2, Pavona clavus; bart3, Pavona gigantea; bart4, Porites
    lobata. Champion - champ1, Pavona gigantea. Urvina Bay - ur1, ur2, ur3, Pavona clavus.
    Study conducted at three sites in Archipelago: del18Ocoral refers to del18O (PDB)
    of coral skeleton. del18O h2O refers to del18O (SMOW) seawater. sst refers to monthly
    sea surface temperatures averaged from hourly instrumental data from each site.
